import React, { useEffect, useState } from 'react';
import { getParkingLogs, logVehicleEntry, logVehicleExit } from '../services/apiService';

const ParkingLog = () => {
  const [logs, setLogs] = useState([]);
  const [licensePlate, setLicensePlate] = useState('');
  const [error, setError] = useState('');

  // Fetch logs on component mount
  useEffect(() => {
    fetchLogs();
  }, []);

  const fetchLogs = async () => {
    try {
      const data = await getParkingLogs();
      setLogs(data);
    } catch (err) {
      console.error('Error fetching logs:', err);
      setError('Failed to fetch parking logs');
    }
  };

  const handleEntry = async () => {
    try {
      const response = await logVehicleEntry({ licensePlate });
      alert(`Entry Success! Slot: ${response.slotNumber}`);
      setLicensePlate(''); // Clear the input field
      fetchLogs(); // Refresh logs
    } catch (err) {
      console.error('Error logging entry:', err);
      alert('Error logging vehicle entry');
    }
  };

  const handleExit = async () => {
    try {
      const response = await logVehicleExit({ licensePlate });
      alert(`Exit Success! Fee: ${response.fee}`);
      setLicensePlate(''); // Clear the input field
      fetchLogs(); // Refresh logs
    } catch (err) {
      console.error('Error logging exit:', err);
      alert('Error logging vehicle exit');
    }
  };

  const formatDate = (dateString) => {
    if (!dateString) return '-';
    return new Date(dateString).toLocaleString('en-US', {
      timeZone: 'Asia/Kathmandu',
      dateStyle: 'medium',
      timeStyle: 'short',
    });
  };

  return (
    <div style={{ padding: '20px' }}>
      <h2>Parking Logs</h2>
      <div style={{ marginBottom: '20px' }}>
        <input
          type="text"
          placeholder="Enter License Plate"
          value={licensePlate}
          onChange={(e) => setLicensePlate(e.target.value)}
          style={{
            padding: '10px',
            marginRight: '10px',
            border: '1px solid #ccc',
            borderRadius: '5px',
          }}
        />
        <button onClick={handleEntry} style={{ marginRight: '10px' }}>
          Entry
        </button>
        <button onClick={handleExit}>Exit</button>
      </div>
      {error && <p style={{ color: 'red' }}>{error}</p>}
      <table border="1" style={{ width: '100%', textAlign: 'center', borderCollapse: 'collapse' }}>
        <thead>
          <tr>
            <th>License Plate</th>
            <th>Entry Time (Nepal Time)</th>
            <th>Slot Number</th>
            <th>Exit Time</th>
            <th>Fee (NPR)</th>
          </tr>
        </thead>
        <tbody>
          {logs.map((log, index) => (
            <tr key={index}>
              <td>{log.licensePlate}</td>
              <td>{formatDate(log.entryTime)}</td>
              <td>{log.slotNumber || '-'}</td>
              <td>{formatDate(log.exitTime)}</td>
              <td>{log.fee || '-'}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ParkingLog;
